import React, { useState } from "react";
import axios from "axios";

const UploadResume = () => {
  const [resumeFile, setResumeFile] = useState(null);
  const [parsedData, setParsedData] = useState(null);
  const [jobDescription, setJobDescription] = useState("");
  const [atsScore, setAtsScore] = useState(null);
  const [matchedKeywords, setMatchedKeywords] = useState([]);
  const [summary, setSummary] = useState("");

  const handleFileChange = (e) => {
    setResumeFile(e.target.files[0]);
    setParsedData(null);
    setAtsScore(null);
    setMatchedKeywords([]);
    setSummary("");
  };

  const handleUpload = async () => {
    if (!resumeFile) return alert("Please select a resume file");

    const formData = new FormData();
    formData.append("resume", resumeFile);

    try {
      const response = await axios.post("http://localhost:5000/upload", formData);
      setParsedData(response.data);
    } catch (error) {
      console.error("Upload error:", error);
    }
  };

  const handleGeminiATS = async () => {
    if (!parsedData || !jobDescription) {
      alert("Please upload a resume and enter job description.");
      return;
    }

    try {
      const response = await axios.post("http://localhost:5000/ats-gemini", {
        resumeText: parsedData.text,
        jobText: jobDescription,
      });

      setAtsScore(response.data.ats_score);
      setMatchedKeywords(response.data.matched_keywords);
      setSummary(response.data.summary);
    } catch (error) {
      console.error("Gemini ATS error:", error);
    }
  };

  return (
    <div style={{ padding: "40px", maxWidth: "800px", margin: "0 auto", fontFamily: "Arial" }}>
      <h1 style={{ textAlign: "center", marginBottom: "30px" }}>üìÑ Resume Analyzer</h1>

      <div style={{ marginBottom: "20px" }}>
        <input type="file" accept=".pdf" onChange={handleFileChange} />
        <button
          onClick={handleUpload}
          style={{
            marginLeft: "10px",
            padding: "8px 16px",
            backgroundColor: "#4CAF50",
            color: "#fff",
            border: "none",
            borderRadius: "5px",
            cursor: "pointer"
          }}
        >
          Upload Resume
        </button>
      </div>

      {parsedData && (
        <div style={{
          border: "1px solid #ccc",
          padding: "20px",
          borderRadius: "8px",
          marginBottom: "20px",
          backgroundColor: "#f9f9f9"
        }}>
          <h3>‚úÖ Resume Details</h3>
          <p><strong>Name:</strong> {parsedData.name}</p>
          <p><strong>Email:</strong> {parsedData.email}</p>
          <p><strong>Phone:</strong> {parsedData.phone}</p>
        </div>
      )}

      <div style={{ marginBottom: "20px" }}>
        <textarea
          value={jobDescription}
          onChange={(e) => setJobDescription(e.target.value)}
          placeholder="Paste job description here..."
          rows={6}
          style={{ width: "100%", padding: "12px", fontSize: "16px", borderRadius: "5px", border: "1px solid #ccc" }}
        />
      </div>

      <button
        onClick={handleGeminiATS}
        style={{
          padding: "10px 20px",
          backgroundColor: "#2196F3",
          color: "#fff",
          border: "none",
          borderRadius: "5px",
          cursor: "pointer",
          fontSize: "16px"
        }}
      >
        üîç Analyze with Gemini
      </button>

      {atsScore !== null && (
        <div style={{ marginTop: "30px" }}>
          <h3>üìä Gemini ATS Score</h3>
          <div style={{
            backgroundColor: "#eee",
            borderRadius: "8px",
            overflow: "hidden",
            height: "30px",
            width: "100%",
            marginBottom: "10px"
          }}>
            <div style={{
              width: `${atsScore}%`,
              backgroundColor:
                atsScore >= 70 ? "#4CAF50" :
                atsScore >= 40 ? "#FFC107" : "#F44336",
              color: "#fff",
              textAlign: "center",
              height: "100%",
              lineHeight: "30px",
              fontWeight: "bold"
            }}>
              {atsScore}%
            </div>
          </div>

          {matchedKeywords?.length > 0 && (
            <div>
              <strong>‚úÖ Matched Keywords:</strong>
              <ul>
                {matchedKeywords.map((kw, idx) => (
                  <li key={idx}>{kw}</li>
                ))}
              </ul>
            </div>
          )}

          {summary && (
            <div style={{ marginTop: "20px" }}>
              <h4>üìù Gemini Resume Summary</h4>
              <p>{summary}</p>
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default UploadResume;
